import React from "react";
import { Wrapper } from "../../App.styles";

function AboutUs() {
  return (
    <Wrapper>
      <h1>About us</h1>
      <p>
        Hello, we are a coffee and tea company. If you buy our products, you
        will be guaranteed a happy life
      </p>
    </Wrapper>
  );
}
export default AboutUs;
